const Product = [
    {
      title: "Coffee",
      items: [
        { name: "Cold Coffee", price: 80 },
        { name: "Chocolate Coffee", price: 150 },
      ],
    },
    {
      title: "Tea",
      items: [
        { name: "Lemon Tea", price: 20 },
        { name: "Masala Tea", price: 25 },
      ],
    },
  ];
  
  export default Product;
